    false,nt"url": null,nt"notes": "This narrative report for Bear River Migratory
    Bird Refuge outlines Refuge accomplishments from January through April of 1947.
    The report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including migratory birds, upland game birds, furbearers,
    predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments and collections and receipts.
    Resource management is outlined; topics include fur harvesting. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses. N-R forms and photographs are
    attached.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
